import React from "react";
import PlaylistAddCheckIcon from '@material-ui/icons/PlaylistAddCheck';

function Header() {
  return (
    <header>
      <h1><PlaylistAddCheckIcon />Keeper</h1>
    </header>
  );
}

export default Header;
